import json

from yogguru.utilities.comparison import GradingModel




class ChatConsumer(AsyncWebsocketConsumer):
    async def connect(self):
      
# ye test room bdlna hogaaaa

        self.room_group_name = 'TestRoom'
        self.leaderboard = {}

        await self.channel_layer.group_add(
            self.room_group_name,
            self.channel_name,
            # self.leaderboard
        )

        await self.accept()

    async def disconnect(self, close_code):
        await self.channel_layer.group_discard(
            self.room_group_name,
            self.channel_name,
        )

        self.leaderboard = {}
        print("Disconnected")


    async def receive(self, text_data):
        # print('recieving')
        receive_dict = json.loads(text_data) 
        # print(receive_dict)
        action = receive_dict['action']


        if(action == 'leaderboard'):
            print('leaderboad')
            self.leaderboard[receive_dict['user']] = [0]*(receive_dict['numOfPoses']+1)
            print(self.leaderboard[receive_dict['user']])
            return

        if(action == 'frame'):
            print('frame entered')
            print(receive_dict)
            gradeModel = GradingModel()
            # poseGrading(self, model, image):
            model = ""
            
            if receive_dict['currentPoseNumIndex']%2 == 0:
                img = ""
            else:
                img = ""
            
            # img = receive_dict['frame']
            print(receive_dict['user'])
            result, accuracy = gradeModel.poseGrading(model, img)
            print(result, accuracy)
            if accuracy > self.leaderboard[receive_dict['user']][receive_dict['currentPoseNumIndex']]:
                self.leaderboard[receive_dict['user']][receive_dict['currentPoseNumIndex']] = accuracy

            print('lb2')
            print(self.leaderboard[receive_dict['user']])
            # for u in self.scope["session"]["leaderboard"]:
            #     print(u, self.scope["session"]["leaderboard"][u])
            return


        if(action == 'getLeaderboardData'):
            lastIndex = len(self.leaderboard[receive_dict['user']]) - 1
            self.leaderboard[receive_dict['user']][lastIndex] = self.leaderboard[receive_dict['user']][lastIndex] + self.leaderboard[receive_dict['user']][receive_dict['currentPoseNumIndex']]

            avgAccuracy = round(self.leaderboard[receive_dict['user']][lastIndex] / (receive_dict['currentPoseNumIndex']+1),2)
            print('avg accuracy', receive_dict['user'], avgAccuracy)
            dict = {'response': avgAccuracy}
            
            await self.send(json.dumps(dict))
            return

        if(action == 'endgame'):
            print('endgame')
            # for u in self.scope["session"]["leaderboard"]:
            #     print(u, self.scope["session"]["leaderboard"][u])
            return

        if(action == 'new-offer') or (action == 'new-answer'):
            receiver_channel_name = receive_dict['message']['receiver_channel_name']
            receive_dict['message']['receiver_channel_name'] = self.channel_name

            await self.channel_layer.send(
                receiver_channel_name,
                {
                    'type' : 'send.sdp',
                    'receive_dict' : receive_dict 
                }
            )
            return

        receive_dict['message']['receiver_channel_name'] = self.channel_name
        await self.channel_layer.group_send(
            self.room_group_name,
            {
                'type' : 'send.sdp',
                'receive_dict' : receive_dict 
            }
        )

    async def send_sdp(self, event):
        receive_dict = event['receive_dict']

        await self.send(text_data = json.dumps(receive_dict)); 